const getUser = () => ({ name: 'Andres', email: 'andres@andres.com' });

console.log(getUser());

// Tarea

function getUsuarioActivo(nombre) {
  return {
    uid: 'ABC567',
    username: nombre
  };
}

const usuarioActivo = getUsuarioActivo('Andres');
